$(document).ready(function(){
	$(document).on("click", ".hiper-practicas", function(){ 
		var banner = $(this).attr("href").replace("#/seccion-catalogo/", "");
		console.log(banner);
		setTimeout(
			function(){
				$("#banner_cronicas").hide();
				$("#banner_materno").hide();
				$("#banner_ninez").hide();
				$("#banner_infecciosas").hide();
				switch(banner){
					case "cronicas": 
						$("#banner_cronicas").show();
						break;
					case "materna": 
						$("#banner_materno").show();
						break;
					case "ninez": 
						$("#banner_ninez").show();
						break;				
					case "infecciosas": 
						$("#banner_infecciosas").show();
						break;
				}				
			}
		, 1000);
		
		
	});
});